import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Customers from "./components/customers/customers";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

      </header>
      <Customers />
    </div>
  );
}

export default App;
